import HomeIcon from "../icons/home.svg";

const NavButtons =
[
    {
        title: "Home",
        icon: homeIcon,
        value: "home",
    },
    {
        title: "Contacts",
        icon: contactsIcon,
        value: "contacts"
    }
];

export const Navbar = (props) =>
{
    return (
    <div className="container--navbar">
        { NavButtons.map((aNavButtonInfo) =>
        {
            const { title, icon, value } = aNavButtonInfo;
            return (
                <div
                    onClick={() => props.handleSelectTab(value) }>
                    { props.icon }
                </div>
            );
        })}
    </div>
    );
};
